import React from 'react';
import ReturnReseT from './Reset';
import { useNavigate } from 'react-router-dom';

// Rest Main Compoennt 
export default function ReseT() {

 const navigation = useNavigate();

 React.useEffect(() => {
  const data = window.localStorage.getItem('ACTIVE');
  const build = window.localStorage.getItem('BUILD');

  JSON.parse(data) != true && navigation('/');
  JSON.parse(build) != true && navigation('/dash');

 }, []);

 return (
  <ReturnReseT />
 );
};
